INSERT INTO `performer` VALUES ('12fd7452-7583-4c41','Travis Scott',1,1,'Jacques Bermon Webster II (born April 30, 1991), known professionally as Travis Scott is an American rapper, singer, songwriter, and record producer.','Active'),('30225198-1483-427c','Kiyo',20,1,'A Filipino rapper that creates lo-fi, indie, and hip-hop music centered on all walks and talks of life. The 22-year-old rapper adapted the artist name “kiyo” in 2018 but started writing songs ever since he was a teenager.','Active'),('3bf5c8b7-4752-4f11','IV Of Spades',4,4,'IV of Spades was a Filipino rock band from Metro Manila, Philippines, consisting of vocalist, bassist and keyboardist Zild Benitez, vocalist and lead guitarist Blaster Silonga, and drummer Badjao de Castro.','Active'),('6a7917e7-caa9-41fc','Joji',18,1,'A Japanese singer and songwriter who has released four studio albums, one mixtape, two extended plays and fourteen singles and his songs have been characterized as having \"down tempo, melancholic themes and soulful vocals\" with \"minimalistic production\". Joji himself classifies his work as dark love songs, with his 2020 album, Nectar, dissecting cliché tropes and topics.','Active'),('6dbfce97-351a-4645','Arctic Monkeys',4,4,'Heralded as one of the first bands to come to public attention via the Internet, with commentators suggesting they represented the possibility of a change in the way in which new bands are promoted and marketed.','Active'),('c95cb391-5b9b-4dbd','Ariana Grande',3,1,'Regarded as a pop icon and an influential figure in popular music, she is noted for her four-octave vocal range and sustaining high notes which includes her signature use of the whistle register.','Active'),('cc35a5ff-c0a3-4b78','Panic! At The Disco',4,4,'Panic! at the Disco was an American pop rock band from Las Vegas, Nevada, formed in 2004 by childhood friends Ryan Ross, Spencer Smith, Brent Wilson, and Brendon Urie.','Active'),('d560df1f-345a-4415','Queen',1,1,'Queen are a British rock band formed in London in 1970 by Freddie Mercury (lead vocals, piano), Brian May (guitar, vocals), and Roger Taylor (drums, vocals), later joined by John Deacon (bass). Their earliest works were influenced by progressive rock, hard rock, and heavy metal, but the band gradually ventured into more conventional and radio-friendly works by incorporating further styles, such as arena rock and pop rock.','Inactive'),('ebdc8913-af78-4ba8','Cigarettes After Sex',12,4,'An American dream pop band that is known for their ethereal, limerent and often dream-like musical style, lyrics often based on the themes of romance and love, as well as Gonzalez\'s voice, which has been described as \"androgynous\".','Active'),('f0197dbe-66a7-41e3','Post Malone',8,1,'Austin Richard Post (born July 4, 1995), known professionally as Post Malone, is an American rapper, singer, songwriter, record producer, and actor. Malone has gained distinction and acclaim for his blending of various genres including hip hop, pop, R&B, and trap.','Active'),('pf001','Dilaw',1,4,'A Filipino rock band formed in Baguio, Benguet. YES SIR','Active'),('pf002','Ben and Ben',2,4,'Award-winning nine piece folk-pop band in Manila.','Active'),('pf003','Kamikaze',3,4,'Filipino rock band formed in 2000.','Active'),('pf004','The Animals',4,4,'British rock-band from Great Britain that started in 1963.','Active'),('pf005','Ed Sheeran',2,1,'Grammy-winning English singer-songwriter.','Active'),('pf006','Hev Abi',4,1,'Rising star in hip hop and alternative hip hop genres.','Active'),('pf007','Rob Deniel',2,1,'Filipino singer-songwriter under Viva Records.','Active'),('pf008','NIKI',1,1,'Indonesian singer-songwriter based in Los Angeles.','Active'),('pf009','Jason Dhakal',1,1,'Contemporary queer R&B singer-songwriter.','Active'),('pf010','Lola Amour',2,4,'Filipino rock band formed in Muntinlupa, Metro Manila, Philippines in 2013.','Active');
